        <div>
            <h2>List</h2>
            {userlist.map((e, i) => <div key={i} style={{ color: 'DarkBlue', margin: '3px' }}>
                <input type="checkbox" name='list' />
                <input type="text" value={e} />
            </div>)}
            <button onClick={() => {deleteName({i}) }} style={{border:'2px solid black' , margin:'5px'}} >Completed </button>
            <button onClick={() => { }} style={{border:'2px solid black' , margin:'5px'}} >InComplete </button>

        </div>
    )
}
export default connect(mapStateToProps,mapDispatchToProps)(Todolist)
